import React from "react";
// nodejs library that concatenates classes
import classNames from "classnames";

// react plugin that creates an input with badges
import TagsInput from "react-tagsinput";

// reactstrap components
import {
    Card,
    CardHeader,
    CardBody,
    CardTitle,
    TabContent,
    TabPane,
    Row,
    Col,
    Button,
    ButtonGroup,
} from "reactstrap";

class Projects extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            horizontalTabs: "allprojects",
            tagsinput: ["HTML/CSS", "ReactJS"]
        };
    }
    changeActiveTab = (e, tabState, tadName) => {
        e.preventDefault();
        this.setState({
            [tabState]: tadName
        });
    };

    handleTagsinput = tagsinput => {
        this.setState({ tagsinput });
      };
    render() {
        return (
            <>
                <div className="content projects">
                    <Col className="mr-auto ml-auto mt-0" md="10">
                        <Card className="card-plain">
                            <CardHeader>
                                <CardTitle tag="h3">Project Categories :</CardTitle>
                                <ButtonGroup
                                    className="btn-group-toggle float-left"
                                    data-toggle="buttons"
                                >
                                    <Button
                                        color="primary"
                                        id="0"
                                        size="sm"
                                        tag="label"
                                        className={classNames("btn-simple", {
                                            active: this.state.horizontalTabs === "allprojects"
                                                ? "active"
                                                : ""
                                        })}
                                        onClick={e =>
                                            this.changeActiveTab(e, "horizontalTabs", "allprojects")
                                        }
                                    >
                                        <input defaultChecked name="options" type="radio" />
                                        <span className="d-none d-sm-block d-md-block d-lg-block d-xl-block">
                                            All Projects
                          </span>
                                        <span className="d-block d-sm-none">
                                            <i className="tim-icons icon-single-02" />
                                        </span>
                                    </Button>
                                    <Button
                                        color="primary"
                                        id="1"
                                        size="sm"
                                        tag="label"
                                        className={classNames("btn-simple", {
                                            active: this.state.horizontalTabs === "webapp"
                                                ? "active"
                                                : ""
                                        })}
                                        onClick={e =>
                                            this.changeActiveTab(e, "horizontalTabs", "webapp")
                                        }
                                    >
                                        <input name="options" type="radio" />
                                        <span className="d-none d-sm-block d-md-block d-lg-block d-xl-block">
                                            Web Applications
                          </span>
                                        <span className="d-block d-sm-none">
                                            <i className="tim-icons icon-gift-2" />
                                        </span>
                                    </Button>
                                    <Button
                                        color="primary"
                                        id="2"
                                        size="sm"
                                        tag="label"
                                        className={classNames("btn-simple", {
                                            active: this.state.horizontalTabs === "websites"
                                                ? "active"
                                                : ""
                                        })}
                                        onClick={e =>
                                            this.changeActiveTab(e, "horizontalTabs", "websites")
                                        }
                                    >
                                        <input name="options" type="radio" />
                                        <span className="d-none d-sm-block d-md-block d-lg-block d-xl-block">
                                            Websites
                          </span>
                                        <span className="d-block d-sm-none">
                                            <i className="tim-icons icon-tap-02" />
                                        </span>
                                    </Button>
                                </ButtonGroup>
                            </CardHeader>
                            <CardBody>

                                <TabContent
                                    className="tab-space"
                                    activeTab={this.state.horizontalTabs}
                                >
                                    <TabPane tabId="allprojects">
                                        <Row>
                                            <Col md="4">
                                                <Card className="portfolio-card">
                                                    <CardHeader>
                                                        <img alt="" src="https://i.imgur.com/bSCTSzw.jpg"></img>
                                                        <h4 className="card-category">Navigation Pills</h4>
                                                        <CardTitle tag="h3">MovoDB</CardTitle>
                                                    </CardHeader>
                                                    <CardBody>
                                                        <p>In publishing and graphic design, lorem ipsum is a placeholder text commonly used to demonstrate the visual form of a document without relying on meaningful content. Replacing the actual content with placeholder text allows designers to design the form of the content before the content itself has been produced.</p>

                                                        <TagsInput
                                                            onChange={this.handleTagsinput}
                                                            tagProps={{ className: "react-tagsinput-tag primary" }}
                                                            value={this.state.tagsinput}

                                                        />

                                                    </CardBody>
                                                </Card>
                                            </Col>
                                        </Row>

                                    </TabPane>
                                    <TabPane tabId="settings">

                                    </TabPane>
                                    <TabPane tabId="options">

                                    </TabPane>
                                </TabContent>
                            </CardBody>
                        </Card>
                    </Col>
                </div>
            </>
        );
    }
}

export default Projects;
